  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for threatened/endangered sea turtles in coastal Hawaii. Vector points
  in this data set represent sea turtle nesting sites, and sea turtle occurrences
  for species that are considered rare in Hawaii. Species-specific abundance, seasonality,
  status, life history, and source information are stored in relational data tables
  (described below) designed to be used in conjunction with this spatial data layer.
  This data set comprises a portion of the Environmental Sensitivity Index (ESI) data
  for Hawaii. ESI data characterize the marine and coastal environments and wildlife
  by their sensitivity to spilled oil. The ESI data include information for three
  main components: shoreline habitats, sensitive biological resources, and human-use
  resources. See also the REPTILES data layer, part of the larger Hawaii ESI database,
  for additional sea turtle information.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
